export function moduleData(){return{props:{data:Object,dataChange:Function},data:function(){return{loading:!0,modData:this.data}},mounted:function(){this.loading=!1;let t=new URLSearchParams(window.location.search);if(t.has("section")){let a=t.get("section");this.modData.currentPage=a}},watch:{modData:{handler(t,a){this.dataChange(t)},deep:!0}},computed:{},methods:{returnPageTitle(){let t=this,a="";for(var e in t.modData.pages){let i=t.modData.pages[e];t.modData.currentPage==i.name&&(a=i.label)}return a},changePage(t){this.modData.currentPage=t;var a=new URLSearchParams(window.location.search);a.set("section",t);var e=window.location.pathname+"?"+a.toString();history.pushState(null,"",e)}},template:'<div>\t  \t<div class="uip-flex uip-margin-bottom-m">\t  \t\t<div class="uip-text-bold uip-text-xxl uip-text-emphasis uip-flex-grow">{{returnPageTitle()}}</div>\t  \t</div>\t  \t<div class="uip-flex uip-gap-xs">\t  \t\t<template v-for="page in modData.pages">\t  \t\t\t<div @click="changePage(page.name)"\t\t\t\t  class="uip-background-muted uip-border-round hover:uip-background-grey uip-cursor-pointer uip-padding-xs uip-text-muted uip-text-bold uip-no-wrap" :class="{\'uip-background-dark uip-text-inverse hover:uip-background-secondary\' : page.name == modData.currentPage}">{{page.label}}</div>\t  \t\t</template>\t  \t</div>\t  </div>'}};